import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header/header';
import Cards from './components/Cards/cards';

function App() {
  return (
    <Router>
    <div className="App">
      <Routes>
        <Route path="/" element={<Cards />} />
      </Routes>
    </div>
    <Header />
  </Router>
  );
}

export default App;
